import TreatmentArea from './components/contact/TreatmentArea';

function App() {
  let appStyle ={
    padding: "20px",
  }
  let list = ["treatment 1", "treatment 2", "treatment 3"]
  return (
    <div style = {appStyle}>
      <TreatmentArea
        list = {list}
      />
    </div>
  );
}

export default App;


